<script>
	import uniIcon from '@/components/uni-icon/uni-icon.vue';
	import {
		mapState,
		mapMutations
	} from 'vuex';

	let that = this;
	var sourceType = [
		['camera'],
		['album'],
		['camera', 'album']
	];
	var sizeType = [
		['compressed'],
		['original'],
		['compressed', 'original']
	];
	let startY = 0,
		moveY = 0,
		pageAtTop = true;
	export default {
		data() {
			return {
				coverTransform: 'translateY(0px)',
				coverTransition: '0s',
				moving: false,
				avatar: '',
				userNameId: '',
				userName: '',
				postText: '',
				pages: '',
				orgName: '',
				cellphone: '',
				email: '',
				province: '',
				city: '',
				district: '',
				uuid: '',
				age: '',
				post: '',
				telephone: '',
				filePath: ''
			};
		},
		components: {
			uniIcon
		},
		computed: {
			...mapState(['hasLogin', 'forcedLogin'])
		},
		//导航栏点击事件
		onNavigationBarButtonTap(e) {
		    console.log("success",e) 
			if(e.index== 0){
				uni.navigateTo({
					url: 'setting/index?'
				});
			}
		},
		onPullDownRefresh() {
			console.log('refresh');
			setTimeout(function() {
				uni.stopPullDownRefresh();
			}, 1000);
			this.getUserInfo();
		},
		methods: {
			...mapMutations(['logout']),
			/**
			 *  会员卡下拉和回弹
			 *  1.关闭bounce避免ios端下拉冲突
			 *  2.由于touchmove事件的缺陷（以前做小程序就遇到，比如20跳到40，h5反而好很多），下拉的时候会有掉帧的感觉
			 *    transition设置0.1秒延迟，让css来过渡这段空窗期
			 */
			coverTouchstart(e) {
				if (pageAtTop === false) {
					return;
				}
				this.coverTransition = 'transform .1s linear';
				startY = e.touches[0].clientY;
			},
			coverTouchmove(e) {
				moveY = e.touches[0].clientY;
				let moveDistance = moveY - startY;
				if (moveDistance < 0) {
					this.moving = false;
					return;
				}
				this.moving = true;
				if (moveDistance >= 60 && moveDistance < 80) {
					moveDistance = 60;
				}

				if (moveDistance > 0 && moveDistance <= 60) {
					this.coverTransform = `translateY(${moveDistance}px)`;
				}
			},
			coverTouchend() {
				if (this.moving === false) {
					return;
				}
				this.moving = false;
				this.coverTransition = 'transform 0.3s cubic-bezier(.21,1.93,.53,.64)';
				this.coverTransform = 'translateY(0px)';
			},
			toMyQR() {
				uni.navigateTo({
					url: 'myQR/myQR'
				});
			},
			bindLogin() {
				uni.navigateTo({
					url: '../login/login'
				});
			},
			bindLogout() {
				this.logout();
				uni.reLaunch({
					url: '../login/login'
				});
				/**
				 * 如果需要强制登录跳转回登录页面
				 */
				//                 if (this.forcedLogin) {
				//                     uni.reLaunch({
				//                         url: '../../index/index',
				//                     });
				//                 }
			},
			getUserInfo: function() {

				// 获取用户信息
				uni.request({
					url: this.$baseUrl+'/mdata/user/getCurrentUser',
					dataType: 'json',
					method: 'POST',
					header: {
						'content-type': 'application/json',
						token: this.$store.state.token
					},
					success: res => {
						this.res = '请求结果 : ' + JSON.stringify(res);
						(this.uuid = res.data.uuid),
						(this.userNameId = res.data.userNameId),
						(this.userName = res.data.userName),
						(this.orgName = res.data.orgName),
						(this.email = res.data.email),
						(this.postText = res.data.postText),
						(this.province = res.data.province),
						(this.cellphone = res.data.cellphone),
						(this.city = res.data.city),
						(this.district = res.data.district),
						(this.avatar = res.data.avatar);
						(this.sex = res.data.sex),
						(this.orgName = res.data.orgName),
						(this.age = res.data.age),
						(this.post = res.data.post),
						(this.postText = res.data.postText),
						(this.telephone = res.data.telephone);

						// console.log(res)
					},
					fail: error => {
						console.log(error);
					}
				});
			},
			goDetail: function(e) {
				var uuId = e.currentTarget.dataset.uuid;
				console.log('uuId:' + uuId);
				uni.navigateTo({
					url: 'mine_details/mine_details?uuId=' + uuId
				});
			},
			chooseImage: function() {
				uni.chooseImage({
					count: 1,
					sizeType: ['compressed'],
					sourceType: ['album'],
					success: res => {
						console.log(res);
						var avatar = res.tempFilePaths[0];

						console.log(avatar);
						uni.uploadFile({
							// url: this.$imageUpdate,
							filePath: avatar,
							fileType: 'file',
							name: 'file',
							header: {
								token: this.$store.state.token
							},
							success: res => {
								console.log(res);
								this.avatar = res.data.substring(13, 117);
								// this.getUserInfo();
								console.log(this.avatar);

								uni.request({
									method: 'POST',
									dataType: 'JSON',
									url: this.$baseUrl+'/document/oss/upload',
									data: {
										uuid: this.uuid,
										userNameId: this.userNameId,
										userName: this.userName,
										sex: this.sex,
										age: this.age || 0,
										postText: this.postText,
										post: this.post,
										avatar: this.avatar,
										telephone: this.telephone,
										email: this.email,
										cellphone: this.cellphone
									},
									header: {
										'content-type': 'application/x-www-form-urlencoded',
										token: token
									},
									success: res => {
										if (res.statusCode == 200) {
											uni.showToast({
												title: '修改成功',
												icon: 'success',
												duration: 1000
											});
										}
									},
									fail: err => {
										console.log('chooseImage fail', err);
									}
								});
							},
							fail: err => {
								console.log('uploadImage fail', err);
								uni.showModal({
									content: err.errMsg,
									showCancel: false
								});
							}
						});
					},
					fail: err => {
						console.log('chooseImage fail', err);
					}
				});
			}
		},
		onLoad() {
			this.getUserInfo();
			setTimeout(function() {
				console.log('start pulldown');
			}, 1000);
			uni.startPullDownRefresh();
		},
		onUnload() {
			this.avatar = '';
		}
	};
</script>

